import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Header, {
  ReactLogo,
  Container
} from "../src/components/FrontEndComponents";
function App() {
  return (
    <div className="App">
      <App header={Container} logo={ReactLogo} />
    </div>
  );
}

export default App;
